import React, { Component } from 'react'

class LifeCycle extends Component {

    constructor(props) {
        super(props)

        this.state = {
             name: 'Toto',
             step: 1
        }

    }


    render() {
        return (
            <div>
                <p>Chargement{this.state.step}</p>
                <p>Nom: {this.state.name}</p>
            </div>
        )
    }

}

export default LifeCycle;
